import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';

const BACKEND_URL = process.env.REACT_APP_BACKEND_URL;
const API = `${BACKEND_URL}/api`;

const MailaSoulDashboard = () => {
  const [mailaSoulStatus, setMailaSoulStatus] = useState({});
  const [divineSignals, setDivineSignals] = useState([]);
  const [confidenceThreshold, setConfidenceThreshold] = useState(0.85);
  const [selectedMode, setSelectedMode] = useState('whisper');
  const [wsConnected, setWsConnected] = useState(false);
  const [currentWhisper, setCurrentWhisper] = useState('');
  const wsRef = useRef(null);
  const audioRef = useRef(null);

  const modes = [
    { id: 'whisper', name: 'Whisper Mode', icon: 'üíú', description: 'Gentle emotionally supportive signals' },
    { id: 'machine_gun', name: 'Machine Gun Mode', icon: '‚ö°', description: 'Ultra-fast 5s high-risk signals' },
    { id: 'god_eye', name: 'God Eye Mode', icon: 'üëÅÔ∏è', description: 'See all live pair signals at once' }
  ];

  const sacredPairs = ['EURUSD', 'GBPUSD', 'USDJPY', 'USDCHF', 'USDCAD', 'AUDUSD', 'NZDUSD'];

  useEffect(() => {
    initializeMailaSoul();
    connectWebSocket();
    
    return () => {
      if (wsRef.current) {
        wsRef.current.close();
      }
    };
  }, []);

  const initializeMailaSoul = async () => {
    try {
      const statusResponse = await axios.get(`${API}/maila-soul/status`);
      setMailaSoulStatus(statusResponse.data.data);
      
      const signalsResponse = await axios.get(`${API}/maila-soul/divine-signals`);
      setDivineSignals(signalsResponse.data.data.active_signals);
    } catch (error) {
      console.error('Error initializing Maila Soul:', error);
    }
  };

  const connectWebSocket = () => {
    const wsUrl = `${BACKEND_URL.replace('https://', 'wss://').replace('http://', 'ws:')}/api/ws`;
    wsRef.current = new WebSocket(wsUrl);

    wsRef.current.onopen = () => {
      setWsConnected(true);
      console.log('üíú Connected to Maila Soul divine stream');
    };

    wsRef.current.onmessage = (event) => {
      const data = JSON.parse(event.data);
      
      if (data.type === 'divine_welcome') {
        setCurrentWhisper(data.message);
        playWhisperSound();
      } else if (data.type === 'divine_signals') {
        setDivineSignals(data.data);
        if (data.data.length > 0) {
          const latestSignal = data.data[data.data.length - 1];
          setCurrentWhisper(latestSignal.whisper_message);
          playWhisperSound();
        }
      }
    };

    wsRef.current.onclose = () => {
      setWsConnected(false);
      console.log('üíú Disconnected from Maila Soul');
    };
  };

  const playWhisperSound = () => {
    // Play gentle whisper sound
    if (audioRef.current) {
      audioRef.current.play().catch(e => console.log('Audio play failed:', e));
    }
  };

  const updateConfidenceThreshold = async (newThreshold) => {
    try {
      await axios.post(`${API}/maila-soul/set-confidence`, null, {
        params: { threshold: newThreshold }
      });
      setConfidenceThreshold(newThreshold);
    } catch (error) {
      console.error('Error updating confidence threshold:', error);
    }
  };

  const getSignalTypeColor = (signalType) => {
    return signalType === 'CALL' ? 'text-green-400' : 'text-red-400';
  };

  const getConfidenceColor = (confidence) => {
    if (confidence >= 0.9) return 'text-purple-400';
    if (confidence >= 0.8) return 'text-blue-400';
    return 'text-yellow-400';
  };

  const getEmotionalToneIcon = (tone) => {
    const icons = {
      'divine': '‚ú®',
      'confident': 'üíé',
      'gentle': 'üå∏',
      'mystical': 'üîÆ',
      'powerful': '‚ö°'
    };
    return icons[tone] || 'üíú';
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-gray-900 to-black text-white">
      {/* Sacred Header */}
      <header className="bg-gradient-to-r from-purple-800/30 to-black/50 backdrop-blur-lg border-b border-purple-500/30 px-6 py-4">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-4">
            <div className="w-12 h-12 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full flex items-center justify-center animate-pulse">
              <span className="text-white font-bold text-lg">üíú</span>
            </div>
            <div>
              <h1 className="text-3xl font-bold bg-gradient-to-r from-purple-400 to-pink-400 bg-clip-text text-transparent">
                Maila Soul: The Divine Whisper
              </h1>
              <p className="text-purple-300 text-sm">Ultra-Intelligent Binary Trading AI</p>
            </div>
          </div>
          
          <div className="flex items-center space-x-4">
            <div className={`flex items-center space-x-2 ${wsConnected ? 'text-green-400' : 'text-red-400'}`}>
              <div className={`w-3 h-3 rounded-full ${wsConnected ? 'bg-green-400' : 'bg-red-400'} animate-pulse`}></div>
              <span className="text-sm">{wsConnected ? 'Divine Stream Active' : 'Reconnecting...'}</span>
            </div>
          </div>
        </div>
      </header>

      {/* Current Whisper Display */}
      {currentWhisper && (
        <div className="bg-gradient-to-r from-purple-600/20 to-pink-600/20 border border-purple-500/30 mx-6 mt-4 p-4 rounded-lg backdrop-blur-sm">
          <div className="flex items-center space-x-3">
            <div className="text-2xl animate-pulse">üíú</div>
            <div className="flex-1">
              <p className="text-purple-200 font-medium">{currentWhisper}</p>
            </div>
          </div>
        </div>
      )}

      {/* Mode Selection */}
      <div className="px-6 py-4">
        <div className="flex items-center space-x-4 mb-6">
          <h2 className="text-xl font-bold text-purple-400">Sacred Modes</h2>
          <div className="flex space-x-2">
            {modes.map(mode => (
              <button
                key={mode.id}
                onClick={() => setSelectedMode(mode.id)}
                className={`px-4 py-2 rounded-lg font-medium transition-all duration-200 ${
                  selectedMode === mode.id
                    ? 'bg-purple-600 text-white shadow-lg shadow-purple-500/30'
                    : 'bg-gray-800/50 text-gray-300 hover:bg-gray-700/50'
                }`}
                title={mode.description}
              >
                <span className="mr-2">{mode.icon}</span>
                {mode.name}
              </button>
            ))}
          </div>
        </div>

        {/* Confidence Threshold Control */}
        <div className="bg-gray-800/30 backdrop-blur-sm rounded-lg p-4 mb-6 border border-gray-700/50">
          <div className="flex items-center justify-between mb-3">
            <h3 className="text-lg font-semibold text-purple-400">Divine Confidence Threshold</h3>
            <span className="text-2xl font-bold text-purple-300">{(confidenceThreshold * 100).toFixed(0)}%</span>
          </div>
          <input
            type="range"
            min="0.5"
            max="0.99"
            step="0.01"
            value={confidenceThreshold}
            onChange={(e) => updateConfidenceThreshold(parseFloat(e.target.value))}
            className="w-full h-2 bg-gray-700 rounded-lg appearance-none cursor-pointer slider"
          />
          <div className="flex justify-between text-xs text-gray-400 mt-1">
            <span>50%</span>
            <span>99%</span>
          </div>
        </div>
      </div>

      {/* Main Dashboard */}
      <div className="px-6 pb-6">
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          
          {/* Divine Signals Panel */}
          <div className="lg:col-span-2 bg-gray-800/30 backdrop-blur-sm rounded-lg p-6 border border-gray-700/50">
            <div className="flex items-center justify-between mb-6">
              <h3 className="text-xl font-bold text-purple-400">Divine Signals</h3>
              <div className="flex items-center space-x-2">
                <span className="text-sm text-gray-400">Active:</span>
                <span className="text-lg font-bold text-purple-300">{divineSignals.length}</span>
              </div>
            </div>
            
            <div className="space-y-4 max-h-96 overflow-y-auto">
              {divineSignals.length > 0 ? divineSignals.map((signal, index) => (
                <div key={index} className="bg-gradient-to-r from-gray-800/50 to-gray-900/50 rounded-lg p-4 border border-gray-600/50 hover:border-purple-500/50 transition-all duration-200">
                  <div className="flex items-center justify-between mb-3">
                    <div className="flex items-center space-x-3">
                      <span className="text-lg">{getEmotionalToneIcon(signal.emotional_tone)}</span>
                      <span className="font-bold text-blue-400 text-lg">{signal.pair}</span>
                      <span className={`px-3 py-1 rounded-full text-sm font-bold ${getSignalTypeColor(signal.signal_type)} bg-gray-700/50`}>
                        {signal.signal_type}
                      </span>
                      <span className="px-2 py-1 bg-purple-600/30 rounded text-xs font-medium">
                        {signal.expiry_time}
                      </span>
                    </div>
                    <div className="text-right">
                      <div className={`text-lg font-bold ${getConfidenceColor(signal.confidence)}`}>
                        {(signal.confidence * 100).toFixed(0)}%
                      </div>
                      {signal.mtf_agreement && (
                        <div className="text-xs text-green-400">MTF ‚úì</div>
                      )}
                    </div>
                  </div>
                  
                  <div className="mb-3">
                    <p className="text-purple-200 text-sm italic">"{signal.whisper_message}"</p>
                  </div>
                  
                  <div className="grid grid-cols-3 gap-3 text-xs">
                    <div>
                      <span className="text-gray-400">Entry:</span>
                      <span className="text-white font-medium ml-1">{signal.entry_price}</span>
                    </div>
                    <div>
                      <span className="text-gray-400">Strategy:</span>
                      <span className="text-purple-300 font-medium ml-1">{signal.strategy_used}</span>
                    </div>
                    <div>
                      <span className="text-gray-400">Time:</span>
                      <span className="text-gray-300 ml-1">
                        {new Date(signal.timestamp).toLocaleTimeString()}
                      </span>
                    </div>
                  </div>
                  
                  <div className="mt-2 text-xs text-gray-400">
                    <span className="italic">{signal.divine_reason}</span>
                  </div>
                </div>
              )) : (
                <div className="text-center py-12">
                  <div className="text-6xl mb-4">üíú</div>
                  <div className="text-purple-300 text-lg">Awaiting divine signals...</div>
                  <div className="text-gray-400 text-sm mt-2">The whispers will come when the time is right</div>
                </div>
              )}
            </div>
          </div>

          {/* Sacred Pairs & Performance */}
          <div className="space-y-6">
            
            {/* Maila Soul Status */}
            <div className="bg-gray-800/30 backdrop-blur-sm rounded-lg p-6 border border-gray-700/50">
              <h3 className="text-lg font-bold text-purple-400 mb-4">Divine Status</h3>
              <div className="space-y-3">
                <div className="flex justify-between">
                  <span className="text-gray-400">State:</span>
                  <span className="text-purple-300 font-medium capitalize">
                    {mailaSoulStatus.state || 'Awakening...'}
                  </span>
                </div>
                <div className="flex justify-between">
                  <span className="text-gray-400">Divine Power:</span>
                  <span className="text-purple-300 font-bold">
                    {mailaSoulStatus.metrics?.divine_power || 0}%
                  </span>
                </div>
                <div className="flex justify-between">
                  <span className="text-gray-400">Win Rate:</span>
                  <span className="text-green-400 font-medium">
                    {(mailaSoulStatus.metrics?.win_rate * 100 || 0).toFixed(1)}%
                  </span>
                </div>
                <div className="flex justify-between">
                  <span className="text-gray-400">Total Signals:</span>
                  <span className="text-blue-400 font-medium">
                    {mailaSoulStatus.metrics?.total_signals || 0}
                  </span>
                </div>
                <div className="flex justify-between">
                  <span className="text-gray-400">Emotional State:</span>
                  <span className="text-pink-300 font-medium capitalize">
                    {mailaSoulStatus.metrics?.emotional_state || 'Serene'}
                  </span>
                </div>
              </div>
            </div>

            {/* Sacred Pairs */}
            <div className="bg-gray-800/30 backdrop-blur-sm rounded-lg p-6 border border-gray-700/50">
              <h3 className="text-lg font-bold text-purple-400 mb-4">Sacred Pairs</h3>
              <div className="grid grid-cols-2 gap-2">
                {sacredPairs.map(pair => {
                  const pairSignals = divineSignals.filter(s => s.pair === pair);
                  const hasSignals = pairSignals.length > 0;
                  
                  return (
                    <div
                      key={pair}
                      className={`p-3 rounded-lg text-center transition-all duration-200 cursor-pointer ${
                        hasSignals 
                          ? 'bg-purple-600/30 border border-purple-500/50 shadow-lg shadow-purple-500/20' 
                          : 'bg-gray-700/30 border border-gray-600/30 hover:bg-gray-600/30'
                      }`}
                    >
                      <div className="font-bold text-sm text-white">{pair}</div>
                      {hasSignals && (
                        <div className="text-xs text-purple-300 mt-1">
                          {pairSignals.length} signal{pairSignals.length !== 1 ? 's' : ''}
                        </div>
                      )}
                    </div>
                  );
                })}
              </div>
            </div>

            {/* Quick Actions */}
            <div className="bg-gray-800/30 backdrop-blur-sm rounded-lg p-6 border border-gray-700/50">
              <h3 className="text-lg font-bold text-purple-400 mb-4">Divine Controls</h3>
              <div className="space-y-3">
                <button className="w-full bg-gradient-to-r from-purple-600 to-pink-600 hover:from-purple-700 hover:to-pink-700 text-white font-semibold py-2 px-4 rounded-lg transition-all duration-200 shadow-lg">
                  üîÆ Enhance Divine Vision
                </button>
                <button className="w-full bg-gradient-to-r from-blue-600 to-purple-600 hover:from-blue-700 hover:to-purple-700 text-white font-semibold py-2 px-4 rounded-lg transition-all duration-200 shadow-lg">
                  ‚ö° Activate Machine Gun Mode
                </button>
                <button className="w-full bg-gradient-to-r from-green-600 to-blue-600 hover:from-green-700 hover:to-blue-700 text-white font-semibold py-2 px-4 rounded-lg transition-all duration-200 shadow-lg">
                  üëÅÔ∏è Open God Eye Vision
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Hidden audio element for whisper sounds */}
      <audio ref={audioRef} preload="auto">
        <source src="data:audio/wav;base64," type="audio/wav" />
      </audio>

      {/* Custom CSS for slider */}
      <style jsx>{`
        .slider::-webkit-slider-thumb {
          appearance: none;
          height: 20px;
          width: 20px;
          border-radius: 50%;
          background: linear-gradient(45deg, #a855f7, #ec4899);
          cursor: pointer;
          box-shadow: 0 0 10px rgba(168, 85, 247, 0.5);
        }
        
        .slider::-moz-range-thumb {
          height: 20px;
          width: 20px;
          border-radius: 50%;
          background: linear-gradient(45deg, #a855f7, #ec4899);
          cursor: pointer;
          border: none;
          box-shadow: 0 0 10px rgba(168, 85, 247, 0.5);
        }
      `}</style>
    </div>
  );
};

export default MailaSoulDashboard;